import { Button, Nav, NavItem } from "reactstrap";
import { Link, useLocation } from "react-router-dom";
import './include.css';

const navigation = [
        {
                title: "Home",
                href: "/starter",
        },
        {
                title: "Alert",
                href: "/alerts",
        },
        {
                title: "Badges",
                href: "/badges",
        },
];

const SidebarList = () => {
        let location = useLocation();

        return (

                <div style={{background: 'white', paddingTop: '15px'}}>
                        <Nav vertical className="sidebarNav">
                                {navigation.map((navi, index) => (
                                        <NavItem key={index} className="sidenav-bg" style={{width:'145px'}}>
                                                <Link
                                                        to={navi.href}
                                                        className={
                                                                location.pathname === navi.href
                                                                        ? "active nav-link py-3 sidebarlist"
                                                                        : "nav-link text-secondary py-3 sidebarlist"
                                                        }
                                                >
                                                        <span className="d-inline-block ">{navi.title}</span>
                                                </Link>
                                        </NavItem>
                                ))}
                        </Nav>
                </div>


        );
};

export default SidebarList;
